import org.apache.spark.sql.DataFrame
import org.apache.spark.sql.types.{DoubleType, StringType, IntegerType, DateType}
import org.apache.spark.sql.{functions => F, Column, SQLContext, Dataset}
import org.apache.spark.sql.expressions.Window

import scala.collection.mutable.{Map => Map}
import java.io.File
import java.sql.Date
import java.text.SimpleDateFormat
import java.util.Calendar

def getListOfFiles(directoryPath: String): List[String] = {
  val file = new File(directoryPath)
  file
  .listFiles
  .filter(_.isFile)
  .map(_.getPath).toList
}

/* 
 * Reads all CSV files in a directory passed as the first parameter
 * Returns MutableMap containing file name as a key and data represented by a data frame
 */
def readAllCsvFiles(directoryPath: String, separator: String, header: Boolean = true): Map[String, DataFrame]  = {
  var dataFrameMap = Map[String, DataFrame]()
  // iteriraj po svim csv datotekama
  for (filePath <- getListOfFiles(directoryPath)) {
    if (filePath.split('/').last.split('.')(1) == "csv") {
      val fileName = filePath.split('/').last.split('.')(0)
      println(fileName)
      dataFrameMap += (fileName -> spark.read.option("header", header).option("sep", separator).option("inferSchema", true).csv(filePath))

    }
  }  
  dataFrameMap
}

def printDistinctDatesCountForDfs(dfs: Map[String, DataFrame]) = {
  for ((dfName, df) <- dfs) {
    if(df.columns.contains("Date")){
      println(dfName)
      println("dates - " + df.select("Date").distinct().count())
      println("years - " + df.withColumn("Year", F.year($"Date")).select("Year").distinct().count())
      println()
    }
  }
}

def describeDfs(dfs: Map[String, DataFrame]) = {
  for((dfName, df) <- dfs) {
    println(dfName)
    df.printSchema()
    df.describe().show()
  }    
}

val countCowsOnDate = (date: Date, profileDf: DataFrame) => {
      profileDf.filter($"EDAT".cast(DateType) <= date && ($"ARDAT".isNull || $"ARDAT".cast(DateType) >= date))
        .select("UniqueIdentifier")
        .distinct()
        .count()
    }
